import React, { Component } from 'react';

import '../sass/Home.scss';
import logo from '../img/logo_white2.svg';
import mockups from '../img/mockups.png';

import ScrollIntoView from 'react-scroll-into-view'

const isMobile = window.innerWidth <= 600;


class Home extends Component {
    render() {
        return (
            <div className="Home">
                <div className="top">
                    <p> New <br/> Degree <br/> Works </p>
                </div>
                <div className="newPlanRow">
                    <div className="newPlanWrap">
                        <a style={{display: "table-cell", textDecoration: "none"}} href="https://danny235320.typeform.com/to/iJ2NhH" target="_blank">
                            <div className = "addButtonText">
                                New Plan
                            </div>
                        </a>
                        <a style={{display: "table-cell", textDecoration: "none"}} href="https://danny235320.typeform.com/to/iJ2NhH" target="_blank">
                            <div className = "addButtonPlus">
                                +
                            </div>
                        </a>
                    </div>
                </div>
                <div className="planRow">
                    <div className="planContainer">
                        <div className="plan">
                            <p className="planName"> COMP + SOPA in 4 Years </p>
                            <p className="planStatus"> </p>
                        </div>
                        <div className="plan"> <p> Plan 2 </p> </div>
                        <div className="plan"> <p> Plan 3 </p> </div>
                        <div className="plan"> <p> Plan 4 </p> </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
